import React from 'react';

const App = () => {
  const profiles = [
    { name: "Taro", ae: 10 },
    { name: "Hanako", age: 5}
  ]
  return (
    <div>
      {
        profiles.map(() => {
          return <User name={profiles.name} age={profiles.age} />
        })
      }
    </div>
  )
}

const User = (props) => {
  return <div>Hi, I am {props.name}!, and {props.age} years old!</div>
}

export default App;
